import { Item } from '../types/Item';

export const items: Item[] = [
    { date: new Date(2022, 5, 28), category: 'food', title: 'McDonalds', value: 69.12 },
    { date: new Date(2022, 5, 28), category: 'food', title: 'Burger King', value: 29.12 },
    { date: new Date(2022, 5, 30), category: 'rent', title: 'Aluguel', value: 1200.00 },
    { date: new Date(2022, 5, 31), category: 'salary', title: 'Salário Mês', value: 6000.00 },

];
